import React from "react";
import styled from "styled-components";

const CoalWrapper = styled.section`
  position: relative;
  width: 100vw;
  min-height: 100vh;
  background-color: #d8d6c8;
  display: flex;
  justify-content: center;
  align-items: center;
`;

const MecaWrapper = styled.div`
  position: absolute;
`;

const Coal = () => {
  return <CoalWrapper></CoalWrapper>;
};

export default Coal;
